import React from 'react';
import Layout from '../components/Layout';
import { Container, Row, Col } from 'react-bootstrap';

const About = () => (
        <Layout>
        <div>
            <Container>
            <h2>About</h2>
            <br />
            </Container>
        </div>
        </Layout>
    )

    export default About;
